INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1000005, "2025/01/31 12:00:00", 190801, 2.12, "カリン", 0.0, 1, 64, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 5, 2, -363.0, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1000006, "2025/01/31 12:00:00", 190801, 1.68, "カリン", 0.0, 2, 64, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 6, 1, -363.0, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1000007, "2025/01/31 12:00:00", 190801, 2.33, "カリン", 0.0, 1, 64, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 7, 2, -363.0, "2030/01/01 14:59:59", 1);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020101, "2025/01/31 12:00:00", 133701, 5.18, "ラビリスタ", -6.0, 7, 61, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 101, 3, -285.0, "2030/01/01 14:59:59", 10201);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020102, "2025/01/31 12:00:00", 133901, 8.77, "クリスティーナ", -2.0, 2, 61, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 201, 1, -285.0, "2030/01/01 14:59:59", 10201);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020103, "2025/01/31 12:00:00", 133801, 15.5, "ネネカ", 0.0, 1, 61, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 301, 6, -285.0, "2030/01/01 14:59:59", 10201);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020201, "2025/02/28 12:00:00", 134301, 9.061, "ランファ", 0.0, 5, 61, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 101, 2, -285.0, "2030/01/01 14:59:59", 10202);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020202, "2025/02/28 12:00:00", 134401, 7.699, "チカ", 0.0, 2, 61, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 201, 1, -285.0, "2030/01/01 14:59:59", 10202);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020301, "2025/03/31 12:00:00", 134601, 8.595, "アオイ", 0.0, 2, 61, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 101, 1, -285.0, "2030/01/01 14:59:59", 10203);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020302, "2025/03/31 12:00:00", 134501, 7.758, "クローチェ", 0.0, 2, 61, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 201, 1, -285.0, "2030/01/01 14:59:59", 10203);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020401, "2025/04/30 12:00:00", 132302, 7.0, "ルイズマリー", 0.0, 6, 61, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 101, 2, -285.0, "2030/01/01 14:59:59", 10204);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020402, "2025/04/30 12:00:00", 132402, 7.904, "イロハ", 0.0, 2, 61, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 201, 1, -285.0, "2030/01/01 14:59:59", 10204);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020403, "2025/04/30 12:00:00", 132502, 8.487, "ソノ", 0.0, 2, 61, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 301, 4, -285.0, "2030/01/01 14:59:59", 10204);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020502, "2025/05/31 12:00:00", 134901, 8.763, "カノン", 0.0, 2, 61, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 101, 1, -285.0, "2030/01/01 14:59:59", 10205);
INSERT INTO `v1_20c111483c35647e7499ca4ac28c91505eb86ca62a788c7450f29c080656566d` VALUES (1020503, "2025/05/31 12:00:00", 134801, 6.417, "ツムギ", 0.0, 3, 61, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 201, 1, -285.0, "2030/01/01 14:59:59", 10205);
